import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './home';
import Qa from './qa';
import Login from './Login';
import CustomerArea from "./CustomerArea";
import CustomerContact from "./CustomerContact";
import CustomerAssetsDetails from "./CustomerAssetsDetails";
import Contact from "./Contact";
import ManagerArea from "./ManagerArea";
import EmployeeArea from "./EmployeeArea";
import EmployeeInventoryUpdate from "./EmployeeInventoryUpdate";
import CustomerPersonalDetails from "./CustomerPersonalDetails";
import CustomerReports from "./CustomerReports";
import EmployeePersonalDetails from "./EmployeePersonalDetails";
import EmployeeContact from "./EmployeeContact";
import EmployeeCalendar from "./EmployeeCalendar";
import ManagerCalendar from "./ManagerCalendar";
import ManagerAvailableInventory from "./ManagerAvailableInventory";
import ManagerSurveyDistribution from "./ManagerSurveyDistribution";
import CustomerSurvey from "./CustomerSurvey";
import AddingNewCustomer from "./AddingNewCustomer";
import Stam from "./stam";

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/home" element={<Home />} />
                <Route path="/Contact" element={<Contact />} />
                <Route path="/qa" element={<Qa />} />
                <Route path="/Login" element={<Login />} />
                <Route path="/CustomerArea" element={<CustomerArea />} />
                <Route path="/CustomerPersonalDetails" element={<CustomerPersonalDetails />} />
                <Route path="/CustomerAssetsDetails" element={<CustomerAssetsDetails />} />
                <Route path="/CustomerContact" element={<CustomerContact />} />
                <Route path="/CustomerReports" element={<CustomerReports />} />
                <Route path="/EmployeeArea" element={<EmployeeArea />} />
                <Route path="/EmployeePersonalDetails" element={<EmployeePersonalDetails />} />
                <Route path="/EmployeeInventoryUpdate" element={<EmployeeInventoryUpdate />} />
                <Route path="/EmployeeCalendar" element={<EmployeeCalendar />} />
                <Route path="/EmployeeContact" element={<EmployeeContact />} />
                <Route path="/ManagerArea" element={<ManagerArea />} />
                <Route path="/ManagerCalendar" element={<ManagerCalendar />} />
                <Route path="/ManagerAvailableInventory" element={<ManagerAvailableInventory />} />
                <Route path="/ManagerSurveyDistribution" element={<ManagerSurveyDistribution />} />
                <Route path="/CustomerSurvey" element={<CustomerSurvey />} />
                <Route path="/AddingNewCustomer" element={<AddingNewCustomer />} />
                <Route path="/stam" element={<Stam />} />
            </Routes>
        </Router>
    );
};

export default App;
